import React from 'react';
import logo from './logo.svg';
import './App.css';

import {List, Header, Container, Segment} from 'semantic-ui-react';

class Topics extends React.Component{
  constructor(props){
    super(props)

    this.state = {
      "topics":[]
    }
  }

  componentDidMount(){
    fetch('/topics')
    .then(res => res.json())
    .then(a => this.setState({"topics":a['topics']}))
  }

  render() {
    let topic_segments = []
    let i = 0;
    for (i; i < this.state.topics.length; i++){
      topic_segments.push(<Segment>this.state.topics[i]</Segment>)
    }
    return(
      <div>
        <List>
          {topic_segments}
        </List>

      </div>
    )
  }
}

export default Topics;
